DROP TABLE IF EXISTS `profiles`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `profiles` (
  `user_id` int unsigned NOT NULL,
  `photo_id` int unsigned DEFAULT NULL,
  `status_id` int unsigned DEFAULT NULL,
  `location_id` int unsigned DEFAULT NULL,
  `about_me` text CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL,
  `religion_id` int unsigned DEFAULT NULL,
  `shool_id` int unsigned NOT NULL,
  `university_id` int unsigned NOT NULL,
  `work_place_id` int unsigned NOT NULL,
  `created_at` datetime DEFAULT CURRENT_TIMESTAMP,
  `updated_at` datetime DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  PRIMARY KEY (`user_id`),
  KEY `profiles_photo_id_fk` (`photo_id`),
  KEY `profiles_status_id_fk` (`status_id`),
  KEY `profiles_location_id_fk` (`location_id`),
  KEY `profiles_religion_id_fk` (`religion_id`),
  KEY `profiles_shool_id_fk` (`shool_id`),
  KEY `profiles_university_id_fk` (`university_id`),
  KEY `profiles_work_place_id_fk` (`work_place_id`),
  CONSTRAINT `profiles_location_id_fk` FOREIGN KEY (`location_id`) REFERENCES `location` (`id`) ON DELETE SET NULL,
  CONSTRAINT `profiles_photo_id_fk` FOREIGN KEY (`photo_id`) REFERENCES `photo` (`id`) ON DELETE SET NULL,
  CONSTRAINT `profiles_religion_id_fk` FOREIGN KEY (`religion_id`) REFERENCES `religion` (`id`) ON DELETE SET NULL,
  CONSTRAINT `profiles_shool_id_fk` FOREIGN KEY (`shool_id`) REFERENCES `shool` (`id`) ON DELETE CASCADE,
  CONSTRAINT `profiles_status_id_fk` FOREIGN KEY (`status_id`) REFERENCES `user_statuses` (`id`) ON DELETE SET NULL,
  CONSTRAINT `profiles_university_id_fk` FOREIGN KEY (`university_id`) REFERENCES `university` (`id`) ON DELETE CASCADE,
  CONSTRAINT `profiles_user_id_fk` FOREIGN KEY (`user_id`) REFERENCES `users` (`id`) ON DELETE CASCADE,
  CONSTRAINT `profiles_work_place_id_fk` FOREIGN KEY (`work_place_id`) REFERENCES `work_place` (`id`) ON DELETE CASCADE
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;
