	FROM users u 
		INNER JOIN profiles p 
			ON u.id = p.user_id 
		INNER JOIN location l 
			ON p.location_id = l.id
		INNER JOIN city c 
			ON l.city_id = c.id 
		INNER JOIN country co 
			ON l.country_id = co.id
		where country.id = country;
end ;;
